zek/events{/privacy}', 'received_events_url': 'https://api.github.com/users/OlgaMaciaszek/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 11, 'created_at': '2021-07-08T15:35:50Z', 'updated_at': '2022-03-29T15:06:47Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'I'm using Spring boot 2.4.5, Spring Cloud 2020.0.3, Java 11.
Is there a way to use a Feign client accepting a `java.time.LocalDate` as an object field where it is supposed to comply with a given format like `@DateTimeFormat` with some specific pattern?
For instance, I have the next object which I wanna represent as query params:

    @AllArgsConstructor
    public class QueryRequestParams {
        @DateTimeFormat(pattern = "dd.MM.yyyy")
        private LocalDate from;
        @DateTimeFormat(pattern = "dd.MM.yyyy")
        private LocalDate to;
    }

The instance of QueryRequestParams  looks like:

    new QueryRequestParams(LocalDate.parse("2011-12-03"), LocalDate.parse("2011-12-05"))

The feign client is:
   
    @FeignClient(url = "http://localhost:9000")
    public interface ExampleFeignClient {
        @GetMapping(produces = MediaType.APPLICATION_JSON_VALUE)
        List<Object> getObjects(@SpringQueryMap QueryRequestParams queryRequestParams);
    }
`
When feign client does request and `QueryRequestParams` object has no null values the request look like as "http://localhost:9000?from=2011-12-03&to=2011-12-05" which has another format rather than I configured via DateTimeFormat annotation.

When I tried to use @DateTimeFormat with @RequestParam annotation just in ExampleFeignClient, for example:

    @GetMapping(produces = MediaType.APPLICATION_JSON_VALUE)
        List<Object> getObjects(@RequestParam("from") @DateTimeFormat(pattern = "dd.MM.yyyy") LocalDate from,
                                @RequestParam("to") @DateTimeFormat(pattern = "dd.MM.yyyy") LocalDate to);

then it works as I expected.
It there a way to use `@SpringQueryMap` with object which contains `LocalDate` field and that is formatted via `@DateTimeFormat(pattern = "dd.MM.yyyy")` annotation?
