ps://api.github.com/users/alceil/subscriptions', 'organizations_url': 'https://api.github.com/users/alceil/orgs', 'repos_url': 'https://api.github.com/users/alceil/repos', 'events_url': 'https://api.github.com/users/alceil/events{/privacy}', 'received_events_url': 'https://api.github.com/users/alceil/received_events', 'type': 'User', 'site_admin': False}], 'milestone': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-netflix/milestones/109', 'html_url': 'https://github.com/spring-cloud/spring-cloud-netflix/milestone/109', 'labels_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-netflix/milestones/109/labels', 'id': 7703167, 'node_id': 'MI_kwDOAUvBQ84AdYp_', 'number': 109, 'title': '3.1.2', 'description': None, 'creator': {'login': 'OlgaMaciaszek', 'id': 4328892, 'node_id': 'MDQ6VXNlcjQzMjg4OTI=', 'avatar_url': 'https://avatars.githubusercontent.com/u/4328892?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/OlgaMaciaszek', 'html_url': 'https://github.com/OlgaMaciaszek', 'followers_url': 'https://api.github.com/users/OlgaMaciaszek/followers', 'following_url': 'https://api.github.com/users/OlgaMaciaszek/following{/other_user}', 'gists_url': 'https://api.github.com/users/OlgaMaciaszek/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/OlgaMaciaszek/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/OlgaMaciaszek/subscriptions', 'organizations_url': 'https://api.github.com/users/OlgaMaciaszek/orgs', 'repos_url': 'https://api.github.com/users/OlgaMaciaszek/repos', 'events_url': 'https://api.github.com/users/OlgaMaciaszek/events{/privacy}', 'received_events_url': 'https://api.github.com/users/OlgaMaciaszek/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 1, 'closed_issues': 4, 'state': 'open', 'created_at': '2022-02-22T16:47:38Z', 'updated_at': '2022-03-18T12:13:36Z', 'due_on': None, 'closed_at': None}, 'comments': 22, 'created_at': '2015-06-05T20:42:15Z', 'updated_at': '2022-03-18T12:13:36Z', 'closed_at': '2022-03-18T12:13:35Z', 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': "Netflix's original version of the Eureka Server avoids to answer clients for a configurable period of time if it starts with an empty registry. This happens when:
- for a standalone server
- for a clustered server when it fails to transfer registry information from peers

This behaviour is controlled by the `waitTimeInMsWhenSyncEmpty` property which is set to 5min by default.

However, that feature seems to be broken in the SpringCloud integrated version. The server answers queries immediately after startup - even with an empty registry. Consequences are that a server restart may cause clients to clear their local caches on their next refresh...

The method `PeerAwareInstanceRegistry.shouldAllowAccess()` is responsible to enforce the warmup period if the registry started empty causing queries to be denied. The interesting part of the code is:

```
public boolean shouldAllowAccess(boolean remoteRegionRequired) {
    if (this.peerInstancesTransferEmptyOnStartup) {
        if (!(System.currentTimeMillis() > this.startupTime
                                           + EUREKA_SERVER_CONFIG.getWaitTimeInMsWhenSyncEmpty())) {
            return false;
        }
    }
```

The variable `startupTime` is initially at zero and is initialised only after all attempts to synchronise with peers are over (which may take up to 2.5 minutes to complete: 5 attempts with 30s delay in between). This part of the initialisation is actually done in a separate thread (see `EurekaServerInitializerConfiguration.start()`) - so the Spring application context finishes its refresh before the Eureka server is fully started. 

So `startupTime` is set to zero for at least the first 2.5 minutes during which  `shouldAllowAccessEmptyOnStartup` let the traffic come in and client requests are then accepted. There is no warmup period anymore.

Conclusion: the restart of a standalone Eureka server (SpringCloud version) may cause clients to clear their local caches.
