1-30T17:52:58Z', 'updated_at': '2022-03-17T10:12:33Z', 'closed_at': '2022-03-17T10:12:33Z', 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'I'm currently trying to get Eureka server running with URL discovery and it proofed to be a bit tricky.

According to the [doc](https://github.com/Netflix/eureka/wiki/Configuring-Eureka-in-AWS-Cloud#configuring-eips-using-dns) the `eureka.eurekaServer.context` (= `eureka.client.eurekaServerURLContext`) should be set to `eureka/v2`. This doesn't work though. The reason is that the Jersey ServletContainer is [mapped](https://github.com/spring-cloud/spring-cloud-netflix/blob/master/spring-cloud-netflix-eureka-server/src/main/java/org/springframework/cloud/netflix/eureka/server/EurekaServerConfiguration.java#L169) at `/eureka/*`. Configuring context to `eureka/v2` results in requests for `/eureka/v2/apps/{appId}` which Jersey matches against a pattern of `/{version}/apps/{appId}`. This pattern therefore doesn't match. 

Leaving out the `/eureka` prefix doesn't work as the path won't be filtered by the Jersey filter. A possible workaround is to simply set the context to `eureka`. This results in `eureka` being treated as the `{version}` which interestingly [is allowed](https://github.com/Netflix/eureka/blob/master/eureka-core/src/main/java/com/netflix/eureka/Version.java#L31).

The fix for this issue is to set Jersey's `PROPERTY_FILTER_CONTEXT_PATH` to `/eureka`:

```
    @Bean
    public FilterRegistrationBean jerseyFilterRegistration(
            javax.ws.rs.core.Application eurekaJerseyApp) {
        FilterRegistrationBean bean = new FilterRegistrationBean();
        bean.setFilter(new ServletContainer(eurekaJerseyApp));
        bean.setOrder(Ordered.LOWEST_PRECEDENCE);
        bean.setUrlPatterns(Collections
                .singletonList(EurekaServerConfigBean.DEFAULT_PREFIX + "/*"));
        bean.setInitParameters(Collections.singletonMap(ServletContainer.PROPERTY_FILTER_CONTEXT_PATH, EurekaServerConfigBean.DEFAULT_PREFIX));
        return bean;
    }
```

This is obviously a major change so I'm not sure this is going to happen. Anyway, since I couldn't find any documentation on this use case though, I believe this is at least a documentation issue.
